import React from 'react';

const templates = [
  {
    title: 'Memescope OG',
    summary: 'Looks for early bonding curve plays with rising buys and wallet overlap.',
    tags: ['Meme', 'Low MC', 'Aggro'],
    winRate: '68%',
    users: 1240,
    color: 'from-pink-400 to-yellow-400',
  },
  {
    title: 'Early Bonding Sniper',
    summary: 'Snipe low cap plays before full bonding curve forms.',
    tags: ['Low Cap', 'Bonding', 'Dev Active'],
    winRate: '72%',
    users: 980,
    color: 'from-blue-400 to-cyan-400',
  },
  {
    title: 'Narrative Surge – GambleFi',
    summary: 'Ride narratives gaining traction in a given day.',
    tags: ['GambleFi', 'Narrative', 'Volume'],
    winRate: '61%',
    users: 1123,
    color: 'from-purple-400 to-fuchsia-400',
  },
  {
    title: 'Safe Flow (Liquidity Watcher)',
    summary: 'Helps new users avoid rugs or sudden exits.',
    tags: ['Safe', 'Liquidity', 'Holder'],
    winRate: '81%',
    users: 1567,
    color: 'from-green-400 to-emerald-400',
  },
];

export default function TemplatesTab({ goBack }) {
  return (
    <div className="w-full max-w-5xl mx-auto py-12">
      {goBack && (
        <div className="pt-12 pl-2">
          <button onClick={goBack} className="flex items-center text-sm text-blue-400 hover:underline focus:outline-none bg-black/50 px-3 py-2 rounded-lg backdrop-blur-sm z-50 relative">
            <span className="mr-2">←</span> Back to Home
          </button>
        </div>
      )}
      <h2 className="text-3xl font-bold text-gray-100 mb-8 text-center">Templates</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {templates.map((tpl, i) => (
          <div
            key={tpl.title}
            className={`relative bg-black/40 backdrop-blur-2xl rounded-2xl border-2 border-zinc-500/40 shadow-2xl p-8 flex flex-col transition hover:scale-105 hover:shadow-lg hover:border-gradient-to-r ${tpl.color} duration-200 group`}
          >
            <div className="flex items-center gap-3 mb-2">
              <span className={`inline-block w-2 h-2 rounded-full bg-gradient-to-r ${tpl.color}`}></span>
              <h3 className="text-2xl font-extrabold text-white drop-shadow group-hover:text-yellow-200 transition">{tpl.title}</h3>
            </div>
            <p className="text-gray-200 text-base mb-3">{tpl.summary}</p>
            <div className="flex flex-wrap gap-2 mb-3">
              {tpl.tags.map(tag => (
                <span key={tag} className="bg-zinc-800/80 text-xs text-gray-200 rounded px-2 py-0.5 font-semibold tracking-wide">{tag}</span>
              ))}
            </div>
            <div className="flex items-center gap-4 text-xs mb-4">
              <span className="flex items-center gap-1 text-green-400 font-bold"><svg width="16" height="16" fill="none" viewBox="0 0 24 24"><path d="M5 13l4 4L19 7" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/></svg>Win Rate: {tpl.winRate}</span>
              <span className="flex items-center gap-1 text-blue-300"><svg width="16" height="16" fill="none" viewBox="0 0 24 24"><path d="M12 12c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm0 2c-2.67 0-8 1.34-8 4v2h16v-2c0-2.66-5.33-4-8-4z" stroke="currentColor" strokeWidth="2"/></svg>{tpl.users.toLocaleString()} users</span>
            </div>
            <button className={`mt-auto px-5 py-2 rounded-lg bg-gradient-to-r ${tpl.color} text-white font-bold shadow hover:brightness-110 transition`}>Try Flow</button>
          </div>
        ))}
      </div>
    </div>
  );
}
